  return (
    <div>
      <div>
        <strong>Total Donations</strong>: {totalAmount}
      </div>
      <div>
        <strong>Number of Donations</strong>: {donationCount}
      </div>
      <div>
        <strong>Active Programs</strong>: {activePrograms}
      </div>
    </div>
  );
}

